import matplotlib.pyplot as plt
import sympy as sym
import numpy as np
from numpy import e, sin, cos, pi
from sympy.plotting import plot3d, plot_implicit, plot
sym.init_printing()

"""Função main"""



"""# ITem 1

![image.png](data:image/png;base64,)

### **Entrada de valores para n,L e p**
"""

n_final = int(input('Insira o valor de n (n > 1): '))
L = int(input('Insira o valor de L (limite superior): '))
p = int(input('Insira o valor de p (passo tipo int): '))

t0 = -2

"""### Declaração variaveis globais e valroes constantes"""

t = np.linspace(t0, L, p)
D0 = 186.3098532

"""### Valor Dn calculado"""

def Dn(n):
  # (e**(pi*n+8) - (e**(-pi*n-8))) / (2*(pi*n + 8))
  return ((cos(pi*n+8) + sin(pi*n+8) - (cos(-pi*n-8) + sin(-pi*n-8))) / (2*(pi*n + 8)))

"""### Série de Fourier"""

def somaSF(N, t):
  soma = np.zeros(np.size(t))
  for n in np.arange(1, N+1):
    soma += Dn(n) * (cos(2*n*t) + sin(2*n*t)) + D0
  return soma

"""### Plotagem do Gráfico"""

def grafico(passo,y, titulo):
    plt.ioff()
    fig = plt.figure(figsize=(15, 8))
    plt.title(titulo)
    plt.grid(True)
    plt.ylabel('f(x)')
    plt.plot(passo,y)
    plt.show()

y = []
aux = 0
titulo1 = "Gráfico 1"
for i in range(len(t)):
    x = np.array(somaSF(n_final, t[i]))
    y.append(x)
grafico(t,y, titulo1)

