### **Entrada de valores para n,L e p**
"""

n_final2 = int(input('Insira o valor de n (n > 1): '))
L2 = int(input('Insira o valor de L (limite superior): '))
p2 = int(input('Insira o valor de p (passo tipo int): '))

t02 = -pi

"""### Declaração variaveis globais e valroes constantes"""

t = np.linspace(t02, L2, p2)
c01 = 4.9348
c02 = 1.644934

"""### Valor Dn1 e Dn2 calculado"""

def Dn1(n):
  #(pi*(-e**(-pi*n)+1)) / (2*n)
  return (pi*(0)) / (2*n)

def Dn2(n):
  #((-pi**2 * n**2) -(2*pi*n) + (2*e**(pi*n) - 2)) / (-2*pi*n**3)
  return (((-pi**2 * n**2) -(2*pi*n) + ((cos(pi*n) + sin(pi*n)) - 2)) / (-2*pi*n**3))

"""### Série de Fourier"""

def somaSF(N, t):
  soma = np.zeros(np.size(t))
  for n in np.arange(1, N+1):
    if t % 2 == 0:
      soma += Dn1(n) * (cos(2*n*t) + sin(2*n*t)) + c01
    else:
      soma += Dn2(n) * (cos(2*n*t) + sin(2*n*t)) + c02
  return soma

"""### Plotagem do Gráfico"""

def grafico(passo,y, titulo, y_label):
    plt.ioff()
    fig = plt.figure(figsize=(15, 8))
    plt.title(titulo)
    plt.grid(True)
    plt.ylabel(y_label)
    plt.plot(passo,y)
    plt.show()

y = []
aux = 0
titulo2 = "Gráfico 2"
for i in range(len(t)):
    x = np.array(somaSF(n_final2, t[i]))
    y.append(x)
grafico(t,y, titulo2, "f(x)")



